import{_ as e,c as a,o as t,d as o}from"./app.1bfde456.js";const r="/fe-handbook/assets/v2-2748a0dbe09fad1b21998c2e64621962_r.638e0479.jpg",u=JSON.parse('{"title":"CNAME","description":"","frontmatter":{},"headers":[{"level":2,"title":"Reference","slug":"reference","link":"#reference","children":[]}],"relativePath":"fundamentals/network/domain-cname.md","lastUpdated":1681663861000}'),c={name:"fundamentals/network/domain-cname.md"},n=o('<h1 id="cname" tabindex="-1">CNAME <a class="header-anchor" href="#cname" aria-hidden="true">#</a></h1><blockquote><p>A记录是将域名解析成IP，CNAME是将域名解析成另外一个域名。</p></blockquote><p><img src="'+r+'" alt="img"></p><blockquote><p>CNAME即别名( Canonical Name )；可以用来把一个域名解析到另一个域名，当 DNS 系统在查询 CNAME 左面的名称的时候，都会转向 CNAME 右面的名称再进行查询，一直追踪到最后的 PTR 或 A 名称，成功查询后才会做出回应，否则失败。</p></blockquote><blockquote><p>你有一台服务器上存放了很多资料，你使用docs.example.com去访问这些资源，但又希望通过documents.example.com也能访问到这些资源，那么你就可以在您的DNS解析服务商添加一条CNAME记录，<a href="http://xn--documents-kj5q.example.xn--comdocs-6y3l252i.example.com" target="_blank" rel="noreferrer">将documents.example.com指向docs.example.com</a>，添加该条CNAME记录后，<a href="http://xn--documents-zj8r943bgm1ilx1a.example.xn--comdocs-oo5kl3u286ekuxalj2co7id9l10f.example.com" target="_blank" rel="noreferrer">所有访问documents.example.com的请求都会被转到docs.example.com</a>，获得相同的内容。</p></blockquote><h2 id="reference" tabindex="-1">Reference <a class="header-anchor" href="#reference" aria-hidden="true">#</a></h2><ul><li><a href="https://blog.csdn.net/DD_orz/article/details/100034049" target="_blank" rel="noreferrer">https://blog.csdn.net/DD_orz/article/details/100034049</a></li></ul>',7),l=[n];function s(d,m,i,p,_,f){return t(),a("div",null,l)}const x=e(c,[["render",s]]);export{u as __pageData,x as default};
